INSERT INTO `company` (`companyID`, `companyName`, `companyClass`, `companyDescription`, `companyEstablishment`, `companyWebsite`, `companyAddDate`, `companyAddedBy`, `ImageID`) VALUES
(1, 'Tricon', 4, 'We are an IT Consulting and Software Services Company headquartered in Bangalore, India with offices in the USA, Australia and the Middle East. We help businesses deliver consistent, compelling, innovative, and agile digital experiences. We are continuously innovating to provide best in class IT consulting, software development services, design services, custom products, mobility, and cloud operations. Our solutions have empowered businesses across industry verticals and geographies to make the right decisions while focusing on their core business', '1997', 'https://www.triconinfotech.com/', '2022-12-19 12:03:29', 7, '1Gjc-4L98OWAMi67ZxkVZQFJuvasj1SMf'),
(2, 'HCL', 1, 'Established in 1976 as one of India’s original IT garage start-ups, HCL is a pioneer of modern computing with many firsts to its credit, including the introduction of the 8-bit microprocessor-based computer in 1978 well before its global peers. Today, the HCL enterprise has a presence across varied sectors that include technology, healthcare, and talent management solutions and comprises three companies – HCL Infosystems, HCL Technologies, and HCL Healthcare. The enterprise generates annual revenues of over US $11.2 Billion global technology firm with over 198,000 professionals operating from 52 countries.', '1976', 'https://hcl.com/', '2022-02-08 00:00:00', 7, NULL),
(3, 'Xceedence', 4, 'Xceedance is a global provider of strategic operations support (SOS), which includes consulting, managed services, data sciences, and technology across the entire insurance lifecycle. Insurance organizations can achieve their target operating models with the help and experience of Xceedance . The company’s proficiency extends to underwriting, actuarial services, catastrophe modeling and exposure management, policy services, claims, BI and reporting, finance and accounting, and application development.', '2013', 'https://xceedance.com/', '2022-12-19 12:04:54', 7, '1ThJ8vuuysy3Pczo1IciAxleVvlWk1CiG'),
(4, 'MG MOTORS', 2, 'MG Motor India Private Limited is an automobile Manufacturer in India, a subsidiary of Chinese automotive manufacturer SAIC Motor which marketed Vehicles under the British MG marque. It was setup in the year 2017 and began its sales and manufacturing operations in 2019.', '2017', 'https://www.mgmotor.co.in/', '2022-12-19 12:06:08', 7, '1nurnWMmdhAFrNKnEcVp683j75n6X2l8i'),
(5, 'Accenture', 1, 'Accenture PLC is an Irish-based multinational professional services company that specializes in IT services and consulting. A Fortune Global 500 company, it reported revenues of $44.33 billion in 2020 and had 569,000 employees. In 2015, the company had about 150,000 employees in India, 48,000 in the US, and 50,000 in the Philippines. Accenture\'s current clients include 91 of the Fortune Global 100 and more than three-quarters of the Fortune Global 500.', '1989', 'https://www.accenture.com/', '2022-12-19 12:07:11', 5, '1X3xx_Hqb9hqZXw0u2eGupIPgZVfIxIgt'),
(6, 'Accolite Digital ', 2, 'Accolite Digital is a leading provider of cloud and digital product engineering services across the banking and financial services, technology, healthcare, communications and media, and logistics industries. It is an innovative, best-in-class digital transformation services provider, successfully delivering design-driven complex digital transformation initiatives to Fortune 500 clients. By being led and product focussed, They are able to drive compelling business outcomes which when applied to other organizations, encourages cross-team collaboration to drive transformation digital experiences no matter your team or industry.', '2007', 'https://www.accolite.com', '2022-12-19 12:07:53', 5, '15RMfChh7pKwFOU0pWk-1tnRBwnJsCFVQ'),
(7, 'Algoscale', 4, 'Algoscale Technologies Inc. is a boutique Data Science and Big Data Analytics firm incorporated in the US with a development center in Noida, India. Applying analytical tools, techniques, and technology, we help organizations gain valuable insights that accelerate business decision-making and increase profitability.', '2014', 'https://algoscale.com/', '2022-12-19 12:11:06', 5, '1Ik49Ws4y_HZchJstAyfnHTJu6DptnOBk'),
(8, 'AMAZON', 3, 'Amazon is an American multinational technology company that focuses on e-commerce, cloud computing, digital streaming, and artificial intelligence. It is one of the Big Five companies in the U.S. information technology industry. The company has been referred to as \"one of the most influential economic and cultural forces in the world\", as well as the world\'s most valuable brand. Amazon is known for its disruption of well-established industries through technological innovation and mass scale. It is the world\'s largest online marketplace, AI assistant provider, live-streaming platform, and cloud computing platform as measured by revenue and market capitalization. Amazon is the largest Internet company by revenue in the world.', '1994', 'https://www.amazon.com/', '2022-12-19 12:11:44', 5, '11IP1OMKKRGzvmCCUUobouvwhBQE_Eo0m'),
(9, 'Capgemini', 1, 'Capgemini was founded by Serge Kampf as an enterprise management and data processing company. Capgemini SE is a French multinational corporation that provides consulting, technology, professional, and outsourcing services. It is headquartered in Paris, France. Capgemini has over 270,000 employees in over 50 countries, of whom nearly 120,000 are in India.', '1 October 1967', 'www.capgemini.com', '2022-12-19 12:12:35', 5, '1Uagy3wlaV0IBXmp0cgPsjvNJ6FbmA3Y1'),
(10, 'Consultadd Inc.', 3, 'Consultadd is a more than 10 years old company in IT consulting with 400+ employees globally. In India, we have an office in Pune with 200+ employees with around 40 people in the engineering team.', '2011', 'https://consultadd.com/', '2022-12-19 12:13:39', 5, '1DUHaXJMca1Oo4Z0AdblSbdb2iwkhXccQ'),
(11, 'CONSULTADD', 4, 'ConsultAdd Inc. is a leading provider of Information Technology consulting and business process services. It offers strategic insights, technological expertise, and industry experience. ConsultAdd is one of the fastest growing IT consulting companies specializing in finance, banking, insurance, healthcare, retail, e-commerce domains and enterprise web development, data warehouse, business intelligence, big data in technologies.\r\nWith over 150 professionals working on information technology projects across the united states, ConsultAdd is headquartered in TX and has a presence in Virginia, Pennsylvania, New York. ConsultAdd\'s offshore center is based in India at Pune.', '2011', 'https://www.consultadd.com/', '2022-02-09 00:00:00', 5, NULL),
(12, 'DXC Technology', 1, 'DXC Technology (NYSE: DXC)?helps global companies run their mission critical systems and operations while modernizing IT, optimizing data architectures, and ensuring security and scalability across public, private and hybrid clouds. With decades of driving innovation, the world’s largest companies trust DXC to deploy the Enterprise Technology Stack to deliver new levels of performance, competitiveness and customer experiences.', '2017', 'https://dxc.com/no/en', '2022-12-19 12:14:15', 5, '1aYYGJn3-qj6wYv1y4GIeCgY5AkTSZd7r'),
(13, 'GalaxE Solution', 4, 'GalaxE Solution, headquartered in Somerset, New Jersey, and established in 1990, is an IT service management company. They offer a variety of solutions, including application development, business consulting, infrastructure and security, digital strategy, and transformation services.', '1990', 'https://galaxe.com/', '2022-12-19 12:15:00', 5, '1wBbsvIqGOOPxAocHP1y19VFOkQqM6dtB'),
(14, 'WIPRO', 1, 'Wipro Limited is an Indian multinational corporation that provides information technology, consulting and business process services. The Fortune India 500 ranks it the 29th largest Indian company by total revenue. It is also ranked the 9th largest employer in India with over 221,000 employees. It is headquartered in Bangalore, Karnataka, India.', '1945', 'https://www.wipro.com/', '2022-12-19 12:15:52', 7, '1wVpS8Pqe8DWnmXEsgfzv3RMNhyGLwnSc'),
(15, 'Saas lab', 4, 'SaaS Labs Inc is a Noida-based software company where we build innovative B2B products for small & medium-sized businesses around the world. Our products like JustCall, CallRoot & Helpwise serve over 100,000 businesses in 40+ countries', '2014', 'http://saaslabs.co', '2022-12-19 12:17:10', 7, '1b4RYgQtXtnTH6t-INYSOiYGRmN-YTow-'),
(16, 'UNTHINKABLE', 4, 'Unthinkable, we help our customers to disrupt faster by decreasing time-to-market via reducing the time gap between an idea and working software. Combining our experience of building 100+ software solutions and developing products using decoupled software components to reduce redundant code, we are in a unique position to make this an unconventional approach to software development. Unthinkable is the software services brand of Applane Solutions LLP, and a group company of Daffodil Software.', '1999', 'www.unthinkable.co', '2022-12-19 12:18:11', 7, '1DUeEyf8KKq8DmkeWfxIzLYvsrXdRj7wQ'),
(17, 'Play Simple', 3, 'Play Simple is one of India’s most exciting, fast-growing and largest mobile gaming companies. Founded in 2014, and backed by Elevation Capital & Chirata e Ventures. Its vision is to create simple, impactful casual game experiences at a massive scale.\r\nIt has built a worldwide network of chart-topping games, and powerful tech & analytics infrastructure to turbo-charge their growth. Its product portfolio consists of fever green hits like Daily Themed Crossword, Word Trip, Word Jam, Word Wars, Word Trek and Solitaire.', '2014', 'http://www.playsimple.in', '2022-12-19 12:18:42', 7, '16wO7tPfhzGchN1k_lJHBIuJKPyd-5BVK'),
(18, 'Pep-Coding', 3, 'Pep-coding, founded in 2017 with the vision to bring in \"The Great Indian Coding Renaissance\". We specialize in teaching in Data Structure, Algorithms and Web Development and getting the best results. Pep-coding stands out as the best place for anyone, be it a beginner or a pro if you are actually in pursuit of achieving excellence in programming.', '2017', 'https://www.pepcoding.com/', '2022-12-19 12:19:25', 7, '1vIX8vQc1ru4V7XnF6pidjq96-xGeeaLm'),
(19, 'OPTUM', 4, 'Optum is a health information technology and services firm that is part of United Health Group. It provides technological, operational and consulting solutions and services to individuals, healthcare organizations, pharmaceutical companies as well as the federal and state governments. Optum has been operating in India since 2006 and has teams supporting health care operations, product development, automation, analytics and data solutions.', '2006', 'https://www.optum.in/', '2022-12-19 12:20:14', 7, '11JaWIWk_IhehMQsgIUmrW5AaBJEwBpJ5'),
(20, 'Lowe\'s', 3, 'Lowe’s Company is a FORTUNE 50 home improvement company serving approximately 20 million customers a week in the United States and Canada. With the fiscal year 2020 sales of close to $90 billion, Lowe’s and its related businesses operate or service more than 2,200 home improvement and hardware stores and employ over 300,000 associates. Based in Mooresville, N.C., Lowe’s supports the communities it serves through programs focused on creating safe, affordable housing and helping to develop the next generation of skilled trade experts.', '1946', 'https://www.lowes.com/', '2022-12-19 12:20:48', 7, '1QG70KpJUB06mtxRGoC51MHvDcpzmLs2g'),
(21, 'Rapi-Pay', 3, 'Rapi-Pay is building the largest network of \"Rapi-Pay Saathis\" - competent and equipped with technology and connectivity to provide retail financial services via a one-stop payments solution platform to its end customers, in a manner that is simple and secure. It brings banking services to your trusted nearby shop helping customers manage their money and keeps their lives moving.', '2009', 'https://www.rapipay.com/web/#/', '2022-12-19 12:21:19', 7, '11JViWxcrAlSBK4k0Dutj0D3IZ1SlMBJJ'),
(22, 'McKinley & Rice', 4, 'McKinley & Rice is a multinational HR management startup operating in South Korea, the U.S., and\r\nIndia. What is an HR management company? It means we’re experts in management, and we’re experts in people. (We’re also experts in recruitment, and we engineer and operate a recruitment platform that\r\ncompetes against LinkedIn, Indeed, and Naukri.) We know why so many international companies are\r\nafraid of entering India. We also know why so many talented employees are unhappy working for\r\noutsourcing consultancies like Infosys or TCS.\r\nWe operate the overseas divisions for various multinational companies. International companies come to\r\nus for top talent, and top talent comes to us for interesting, meaningful jobs. In India, we\'re located in Noida and Pune with a total of around 70+ innovative people working for various MNCs, and as a startup, we’ve been growing explosively at 300% year after year.', '2018', 'https://www.mckinleyrice.com/', '2022-02-25 20:11:53', 7, NULL),
(23, 'Josh Technology Group', 3, 'JTG Software has been providing advanced and customized technological solutions for its clients for over a decade with a focus on overcoming business challenges, empowering companies, and unlocking new opportunities for business growth and increased revenue. With a rapidly growing client base across countries like the United States, Ukraine, Russia, Costa Rica, China, Bangladesh, and Brazil (to name a few), JTG strives to make a mark in the technology industry by leveraging the latest in technology to solve problems and create a paradigm shift in the business landscape globally. Catering to diverse domains including automotive, manufacturing, healthcare, financial services, and telecommunications, our platforms, services, tools, and methodology are helping organizations become future-ready.', '2009', 'https://www.joshtechnologygroup.com/', '2022-12-19 12:23:00', 7, '17Mtmt3FRSVPUpwMHIQQtFmSkIgt2fRvp'),
(24, 'ION Group', 3, 'ION Group is a privately held, global financial software and data firm that provides technology for trading and execution, risk management and position calculation, connectivity to exchanges and markets, and technology for middle and back-office processes. The firm offers its software across most asset classes and works with trading and brokerage firms, multinational corporations, governments, and central banks.', '1999', 'https://iongroup.com/', '2022-12-19 12:23:33', 7, '1nYd3t9UHy7jXWD3JECv722mSGwTMuBq1'),
(25, 'Appinventiv technology', 4, 'Appinventiv is a leading global App Development Company that\'s Empowering Disruptive Startups & Fortune 500 companies in bridging the gap between Ideas and Reality through innovative Mobile solutions. We have a talented team of 500+ Mobility experts, who have successfully Designed, Developed & Delivered more than 900+ Mobile Apps globally in just 5 years.\r\n\r\nBreaking all growth records, we believe our Work Culture is what drives us and made all this possible to have emerged as one of the most trusted & fastest growing company in the Industry.', '08 June 2016', 'https://appinventiv.com/', '2022-12-19 12:24:10', 5, '1VcgM7Anlsw41Ti9PLPRZE11o3xmtUwvX'),
(26, 'Infosys ', 1, 'Infosys provides software development, maintenance, and independent validation services to companies in finance, insurance,  manufacturing, and other domains. Infosys Limited is an Indian multinational information technology company that provides business consulting, information technology, and outsourcing services. The company was founded in Pune and is headquartered in Bangalore .One of its known products is Finacle which is a  universal banking solution with various modules for retail and corporate banking.', '1981', 'www.infosys.com', '2022-02-14 00:00:00', 7, NULL),
(27, 'Info Edge', 4, 'Info Edge has an in-depth understanding of the Indian consumer internet domain. With years of experience in the domain, strong cash flow generation, and a diversified business portfolio, it is one of the very few profitable pure play internet companies in the country.', '1 May 1995', 'http://www.infoedge.in', '2022-12-19 12:25:35', 7, '1JGL779Pn829VQl2T7cKdXKZnphtg0SAo'),
(28, 'HEXAWARE', 4, 'Hexaware is a fast-growing automation-led next-generation service provider delivering excellence in IT, BPO, and consulting services. They are driven by a combination of robust strategies, passionate teams, and a global culture rooted in innovation and automation. \r\n\r\nHexaware’s Digital offerings have helped clients achieve operational excellence and customer delight. Their focus lies on taking a leadership position in helping clients attain customer intimacy as their competitive advantage.', '1990', 'https://hexaware.com/', '2022-12-19 12:26:14', 7, '1V1QGuzFKspJ2r9lqMdB9rhbElBzxTVvH'),
(29, 'Hevo data', 3, 'Hevo is a no-code data pipeline platform that helps new-age businesses integrate their data from multiple sources to any data warehouse in almost real-time. The platform supports 100+ ready-to-use integrations across Databases, SaaS Applications, Cloud Storage, SDKs, and Streaming Services.', '2016', 'https://hevodata.com/', '2022-02-14 00:00:00', 7, NULL),
(30, 'Cloud Analogy', 4, 'Cloud Analogy is a top-rated Salesforce development and consulting company of 210+ certified professionals and consultants. They have deep domain knowledge and skilful expertise in providing the best-in-class Salesforce implementation, consulting, and migration services for your businesses, primarily Global Fortune 500 companies and some of the world’s largest CRM-powered companies.', '2015', 'https://www.cloudanalogy.com/', '2022-12-19 12:27:54', 7, '1V1QGuzFKspJ2r9lqMdB9rhbElBzxTVvH'),
(31, 'HEALTHKART', 4, 'HealthKart is India’s leading nutrition and supplement platform that offers a comprehensive range of products, engagement tools, and expert assistance for all your wellness and fitness needs.', '2011', 'https://www.healthkart.com/', '2022-12-19 12:29:02', 7, '1ObW8x9-EwHiXiGM47EWAdTU_QCYNxMYR'),
(32, 'InvestWell', 4, 'InvestWell builds software and mobile applications for Mutual Fund Distributors, Independent Financial Advisors, and investors for making and tracking investments in various securities.  It was opened in 2000 and since then has built numerous software applications for financial advisors. It is based in New Delhi and is serving clients in over 70 cities in India. It also offers services for customized development and integration services.   We develop and maintain a large number of financial advisor web portals, and provide quality web content services for such portals.', '2000', 'https://www.investwellonline.com/', '2022-12-19 12:29:49', 7, '1SI920cEDG16CicEqs3jbG8LtNxlylYDo'),
(33, 'upGrad', 1, 'upGrad is an Indian online higher education company, founded in 2015. The company is the official education partner for the Government of India - Startup India program. The EdTech company offers online programs to working professionals, college students, and corporates in the fields of IT,  data science, management and technology.', '2015', 'https://www.upgrad.com/', '2022-02-17 00:00:00', 5, NULL),
(34, 'Kuliza', 4, 'Kuliza is a leading provider of digital transformation and operational intelligence solutions for financial enterprises. Since 2006, Kuliza has executed more than 120 digital transformation projects for global startups and industry-leading global enterprises. Lend. In is Kuliza’s flagship lending product, The low code lending suite for banks and lending institutions to increase the overall efficiencies while decreasing the cost and go-to-market time for customers. The idea to scale, evolve, and continuously improve loan processing by leveraging the customer-centric design and new-age technologies is brought live using Lend.', '2006', 'http://www.kuliza.com', '2022-02-17 00:00:00', 7, NULL),
(35, 'BYJU’s', 1, 'BYJU\'S is an Indian multinational educational technology company, headquartered in Bangalore and  established in 2011. As of June 2021, BYJU\'S is worth US $18 billion, making it one of the world\'s most valuable educational technology companies in the world.', '2011', 'https://byjus.com/', '2022-02-17 00:00:00', 5, NULL),
(36, 'Chegg', 1, 'Chegg Inc. is an American education technology company based in Santa Clara, California. It provides digital and physical textbook rentals, textbook solutions, online tutoring, and other student services. The company was launched in 2005 and began trading publicly on the New York Stock Exchange in November 2013.', '2005', 'https://www.chegg.com/', '2022-02-17 00:00:00', 5, NULL),
(37, 'HINDUSTAN UNILEVER', 1, 'Hindustan Unilever Limited is a consumer goods company, headquartered in Mumbai, India. It is a subsidiary of Unilever, a British company. Its products include foods, beverages, cleaning agents, personal care products, water purifiers, and other fast-moving consumer goods.', '1933', 'https://www.hul.co.in/', '2022-02-17 00:00:00', 5, NULL),
(38, 'UKG(Kronos)', 1, 'Ultimate Kronos Group is an American multinational technology company with dual headquarters in Lowell, Massachusetts, and Weston, Florida. It provides workforce management and human resource management services.', '1977', 'https://www.ukg.com/', '2022-02-17 00:00:00', 5, NULL),
(39, 'KPIT', 1, 'KPIT Technologies Limited is an Indian multinational corporation,headquartered in Pune, Maharashtra, India. Popularly known as KPIT, it provides software to automotive companies. KPIT has development centers in Europe, USA, Japan, China, Thailand and India.', '1990', 'https://www.kpit.com/', '2022-02-17 00:00:00', 5, NULL),
(40, 'COGNIZANT', 1, 'Cognizant is an American multinational technology company that provides business consulting, information technology, and outsourcing services. The major employee base of the company lies in Chennai, Tamil Nadu. There are other branch offices of Cognizant India in various cities across the country including Kolkata, Bangalore, Hyderabad, Mumbai, Pune, Coimbatore and Cochin.', '1994', 'https://www.cognizant.com/in/en', '2022-02-17 00:00:00', 5, NULL),
(41, 'Country Delight ', 4, 'Country Delight delivers farm-fresh cow and buffalo milk to your doorstep within a few hours of milking.', '2015', 'https://countrydelight.in/', '2022-02-17 00:00:00', 7, NULL),
(42, 'DishTV', 4, 'DishTV India is an Indian direct broadcast satellite service provider in India with Yes Bank as the biggest stake owner. DishTV was launched by the Zee Group on 2 October 2003. It ranked # 437 and # 5 on the list of media companies in the Fortune India 500 roster of India\'s largest corporations in 2011.', '2003', 'https://www.dishtv.in/', '2022-02-17 00:00:00', 7, NULL),
(43, 'IFFCO-TOKIO', 4, 'IFFCO-Tokio General Insurance Company Limited was incorporated in 2000, as a joint venture between the Indian Farmers Fertiliser Cooperative Limited (IFFCO), which is the world’s largest fertilizer manufacturer, and Tokio Marine Group, which is one of the largest insurance groups in Japan. IFFCO holds 51 percent of the company and the remaining 49 percent is held by Tokio Marine Group.', '2000', 'https://www.iffcotokio.co.in/', '2022-02-17 00:00:00', 7, NULL),
(44, 'Juspay Technology', 3, 'JUSPAY is a payments exchange connecting merchants, payment providers, and banks. With a deep focus on delivering seamless payments UX at scale, we are trusted partners for all major internet companies in India. After surpassing 200M SDK installs, building systems handling the highest payments traffic in India of 2000 transactions per second, we are now making the next stride to power end-to-end payments for India.', '2012', 'https://juspay.in/', '2022-02-17 17:22:06', 7, NULL),
(45, 'Morgan Stanley', 3, 'Morgan Stanley is an American multinational investment bank and financial services company headquartered at 1585 Broadway in the Morgan Stanley Building, Midtown Manhattan, New York City. With offices in more than 42 countries and more than 60,000 employees, the firm\'s clients include corporations, governments, institutions, and individuals. Morgan Stanley ranked No. 67 in the 2018 Fortune 500 list of the largest United States corporations by total revenue.', '1935', 'https://www.morganstanley.com/', '2022-02-17 17:10:43', 7, NULL),
(46, 'Samsung R&D', 4, 'Samsung R&D Institute India-Noida (SRI-Noida) is a dedicated mobile software R&D centre of Samsung India Electronics Private Limited. SRI-Noida’s young and talented workforce aims to deliver quality and advanced products with passion and speed. The environment fosters collaboration; teamwork and provides a platform for quick decisions and implementations. Year on year, new achievements added feathers to our cap. In just a decade of its journey, SRI-Noida expanded from 40 people to over 2300 people, shifted to a state of the art campus dedicated to mobile R&D, and boasts of over 400 patents filed globally, that serves as a testament to our culture of innovation.', '1996', 'https://research.samsung.com/', '2022-02-17 00:00:00', 7, NULL),
(47, 'Flipkart', 3, 'Flipkart is an Indian e-commerce company, headquartered in Bangalore, Karnataka, India, and incorporated in Singapore as a private limited company. The company initially focused on online book sales before expanding into other product categories such as consumer electronics, fashion, home essentials, groceries, and lifestyle products.\r\nThe service competes primarily with Amazon\'s Indian subsidiary and domestic rival Snapdeal. As of March 2017, Flipkart held a 39.5% market share of India\'s e-commerce industry.', '2007', 'https://www.flipkartcareers.com/', '2022-02-17 00:00:00', 7, NULL),
(48, 'Goldman Sachs', 3, 'The Goldman Sachs Group, Inc. is a leading global financial institution that delivers a broad range of financial services across investment banking, securities, investment management, and consumer banking to a large and diversified client base that includes corporations, financial institutions, governments, and individuals.\r\nFounded in 1869, the firm is headquartered in New York and maintains offices in all major financial centres around the world.', '1869', 'https://www.goldmansachs.com', '2022-02-17 00:00:00', 7, NULL),
(49, 'Gemini Solutions', 4, 'Gemini Solutions is a global IT firm, a leading offshore outsourcing company with a specialized focus on financial services. Gemini offers several management services and can combine our range of services to suit a diverse range of needs. Having a well-equipped automated corporate office in Gurgaon and a nationwide network of associate offices.', '2012', 'https://www.geminisolutions.com/', '2022-02-18 00:00:00', 5, NULL),
(50, 'INFOGAIN', 4, 'Infogain is a human-centric digital platform and software engineering company based in Silicon Valley. We design business outcomes for Fortune 500 companies and digital natives in the areas of healthcare, insurance, travel, telecom, and retail & CPG industries using technologies such as cloud, microservices, automation, IoT, and artificial intelligence. We are accelerating experience-based transformation in delivering digital platforms. Infogain is also a Microsoft Gold Partner and Azure Expert Managed Services Provider (MSP).', '1990', 'https://www.infogain.com/', '2022-02-18 00:00:00', 5, NULL),
(51, 'InnoBit Systems', 4, 'InnoBit Systems Private Limited is an unlisted private company incorporated on 18 December, 2018. It is classified as a private limited company and is located in Gautam Buddha Nagar, Uttar Pradesh. It’s authorized share capital is INR 1.00 lac and the total paid-up capital is INR 1.00 lacs.\r\nIt brings product thinking from our years of experience of having delivered products in various domains such as Internet of Things (IoT), cloud computing, artificial intelligence, machine learning, collaboration, and multimedia', '2018', 'https://innobitsystems.com/', '2022-02-18 00:00:00', 5, NULL),
(52, 'Internet Research Bureau', 4, 'Internet Research Bureau is a global survey company, specializing in quantitative online research and respondent engagement.The headquarter is in New Delhi with regional headquarters in the US and in the UK, Internet Research Bureau serves clients in over 40 countries worldwide. The core services include engaging with niche consumer panels globally to gain market insights and designing, programming, and conducting client surveys. The company relies on organically acquired and relevant data sources.', '2011', 'https://www.irbureau.com/', '2022-02-18 00:00:00', 5, NULL),
(53, 'POSist', 4, 'This company was launched in 2012, POSist is a leading cloud-based restaurant technology platform suited for restaurants of all sizes. POSist offers scalable, reliable, and easy-to-use point-of-sale technology, enabling businesses to automate operations, integrate with aggregators, delight guests, and grow their revenue. POSist is trusted by over 10,000+ restaurants in 35 countries worldwide.', '2012', 'https://www.posist.com/', '2022-02-18 00:00:00', 5, NULL),
(54, 'Artech Infosystem', 1, 'Artech is a women-owned business enterprise (WBE) committed to maximizing global workforce solutions on behalf of its clients. Artech\'s deep heritage, proven expertise, and insightful market intelligence have secured long-term partnerships with Fortune 500 and government clients seeking world-class professional resources. Artech provides the most innovative, efficient, and cost-effective workforce solutions in today\'s marketplace. Artech leverages its mature, quality-certified processes to provide a variety of standard and customized solutions and programs to help clients optimize their supply chain and increase time to market of their workforce requirements, hence, accelerating project progress', '1992', 'https://www.artechinfo.in/', '2022-02-18 00:00:00', 7, NULL),
(55, 'BITCS', 1, 'The BITCS community includes experts from around the globe with expertise in a wide variety of software development languages and technologies. We work around the best technology to provide you with quality products, enhance your business on a global level and come up with all the market-leading solutions for you.', '2017', 'https://bitcs.in/', '2022-02-18 00:00:00', 7, NULL),
(56, 'MothersonSumi', 1, 'Motherson Sumi Systems Limited is an Indian manufacturer and global supplier of automotive components. Established in 1986 and part of the Motherson Group, Motherson Sumi Systems is a joint venture between Samvardhana Motherson International Ltd of India and Sumitomo Wiring Systems Ltd. of Japan.', '1986', 'https://www.motherson.com/', '2022-02-18 00:00:00', 7, NULL),
(57, 'Newgen', 1, 'Newgen is the leading provider of a unified digital transformation platform with native process automation, content services, and communication management capabilities. Globally, successful enterprises rely on Newgen’s industry-recognized low code application platform to develop and deploy complex, content-driven, and customer-engaging business applications on the cloud. From onboarding to service requests, lending to underwriting, and for many more use cases across industries. Newgen unlocks simplicity with speed and agility.', '1992', 'https://newgensoft.com/', '2022-02-18 00:00:00', 7, NULL),
(58, 'Sunstone Eduversity', 1, 'Sunstone Eduversity is India’s first higher education provider to take complete accountability of a students’ career through their pay after placement MBA, PGDM, BBA, Online MBA & MCA programs. It offers UGC/AICTE approved programs in partnership with 23+ leading campuses across the country. Sunstone aims to make higher education more accountable, pragmatic and tailored to the demands of the corporate world. Through this, Sunstone enhances the skill set of students in addition to making them, capable professionals.', '2011', 'https://sunstone.edu.in/', '2022-02-18 00:00:00', 7, NULL),
(59, 'EPAM', 4, 'EPAM Systems, Inc. is an American company that specializes in product development, digital platform engineering, and digital product design. One of the world\'s largest manufacturers of custom software and consulting providers. The company\'s headquarters is located in Newtown, Pennsylvania, and its branches are represented in more than 40 countries.', '1983', 'https://www.epam.com/', '2022-02-18 18:24:05', 7, NULL),
(60, 'Lens Corporation USA', 3, 'A better world with machine vision. Founded in the city of Lansing, MI, in 2016, LENS has grown into a global enterprise. We provide state-of-the-art AI solutions developed in-house with the help of professionals and academicians working around the globe.', '2016', 'https://lenscorp.ai/', '2022-02-19 00:00:00', 7, NULL),
(61, 'The Bank of New York Mellon', 3, 'The Bank of New York Mellon Corporation, commonly known as BNY Mellon, is an American investment banking services holding company headquartered in New York City. BNY Mellon was formed from the merger of The Bank of New York and the Mellon Financial Corporation in 2007. It is the world\'s largest custodian bank and asset servicing company; it is considered a systemically important bank by the Financial Stability Board. BNY Mellon is incorporated in Delaware.', '2007', 'https://www.bnymellon.com/', '2022-02-19 00:00:00', 7, NULL),
(62, 'Vinculum Solutions', 1, 'Vinculum Solutions is the Point of Difference between Selling and Smart selling. If you want to make scaling your business as easy as reading our bio, then this is your one-stop solution to support consistent growth by recognizing and overcoming any real-time retail challenge. We help save time and money for quick digital expansion using 150+ ready integrations of marketplaces, web stores & last-mile fulfilment companies that are built-in to our software.', '2007', 'https://www.vinculumgroup.com/', '2022-02-19 00:00:00', 7, NULL),
(63, 'Sunstone Eduversity', 4, 'Sunstone aims to make higher education more accountable, pragmatic, and tailored to the demands of the corporate world. Through this, Sunstone enhances the skill set of students in addition to making them capable professionals.', '2015', 'https://sunstone.in/', '2022-02-19 00:00:00', 5, NULL),
(64, 'Tech Mahindra', 4, 'Tech Mahindra is an Indian multinational technology company that provides Information Technology (IT) and Business Process Outsourcing (BPO) services. Tech Mahindra is one of the fastest-growing brands and amongst the top 15 IT service providers globally. Tech Mahindra has consistently emerged as a leader in sustainability and is recognized amongst the 2021 global 100 most sustainable corporations in the world by Corporate Knights.', '1986', 'https://www.techmahindra.com/', '2022-02-19 00:00:00', 5, NULL),
(65, 'Career Labs', 4, 'Since their inception in 2019, CareerLabs has successfully garnered the trust of thousands of college students & young working professionals, becoming the go-to place for all their career needs. Envisioning to empower 1 million undergraduate craft the careers of their choosing, they offer a variety of aptly matched and mentor-driven preparatory programs for national & international entrance exams and admissions consulting services for graduate & business schools, both abroad and in India.', '2019', 'https://thecareerlabs.com/', '2022-02-19 00:00:00', 5, NULL),
(66, 'Cisco', 3, 'Cisco facilitates to capture the opportunities of tomorrow by proving that amazing things can happen when you connect the unconnected. An integral part of our DNA is creating long-lasting customer partnerships, working together to identify our customers needs and provide solutions that fuel their success. Cisco has preserved this keen focus on solving business challenges since our founding in 1984. Len Bosack and wife Sandy Lerner, both working for Stanford University, wanted to email each other from their respective offices, but technological shortcomings did not allow such communication. A technology had to be invented to deal with disparate local area protocols, and as a result of solving their challenge, the multiprotocol router was born.', '1984', 'https://www.cisco.com/', '2022-02-19 00:00:00', 5, NULL),
(67, 'Tata Consultancy Services', 4, 'Tata Consultancy Services (TCS) is an Indian multinational information technology (IT) services and consulting company, headquartered in Mumbai, Maharashtra, India with its largest campus located in Chennai, Tamil Nadu, India. As of February 2021, TCS is the largest IT services company in the world by market capitalization ($200 billion). It is a subsidiary of the Tata Group and operates in 149 locations across 46 countries.', '1968', 'https://www.tcs.com/', '2022-02-19 00:00:00', 5, NULL),
(68, 'HSO India', 4, 'HSO leverages the full power of Microsoft technology to transform the way we work and improve business performance. They help companies modernize business operations, adopt intelligent automation, deliver real-time performance insights and connect the enterprise – accelerating the impact of digital transformation. Founded in 1987 and recognized as a trusted advisor, HSO is one\r\nof the world’s top business solution and implementation partners, large enough to serve, small enough to care.', '1987', 'https://www.hso.com/', '2022-02-24 00:00:00', 4, NULL);
INSERT INTO `companydatadivided` (`dataID`, `companyID`, `companyNumOfRounds`, `companyCTC`, `companyEligibility`, `companyJOBProfile`, `companyFirstRoundName`, `companyFirstRoundDescrip`, `companyFirstRoundDuration`, `companySecondRoundName`, `companySecondRoundDescrip`, `companySecondRoundDuration`, `companyThirdRoundName`, `companyThirdRoundDescrip`, `companyThirdRoundDuration`, `companyFourthRoundName`, `companyFourthRoundDescrip`, `companyFourthRoundDuration`, `companyAdditionalRoundDescrip`, `companyReportApprovalStatus`, `companyPracticeDetails`, `companyReportAddDate`, `companyReportAddedBy`, `companyReportYear`, `reportFeedBack`) VALUES
(1, 17, 3, 'Rs.20 LPA ', '65% in 10th, 12th, B. Tech. (till 5th Semester aggregate) with No Backlog History ', 'Software Development Engineer', 'Online Test', 'Coding and Aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ, Response, and Coding based.\r\nThis round contains two sections.\r\nSection 1- This section contains Aptitude Questions.\r\nSection 2- This section contains Coding & DBMS related.\r\n*Aptitude, verbal ability, and logical reasoning.\r\n*DBMS\r\n*Coding\r\n', '2 Hr', 'TECHNICAL INTERVIEW', 'How do you enforce relational integrity in database design?\r\nWhen is it appropriate to de-normalize database design?\r\nWhat is the difference between OLAP and OLTP? When is each used?\r\nWhat automated-build tools or processes have you used?\r\nWhat is the role of continuous integration systems in the automated-build process?\r\nDescribe the difference between optimistic and pessimistic locking.\r\nIn databases, what is the difference between a delete statement and a truncate statement?\r\nWhat are transaction logs, and how are they used?\r\nWhat are the most important database performance metrics, and how do you monitor them?\r\nWhat development tools have you used?\r\nWhat languages have you programmed in?\r\nWhat source control tools have you used?\r\nDescribe the elements of an in-tier architecture and their appropriate use.\r\nCompare and contrast REST and SOAP web services.\r\nDefine authentication and authorization and the tools that are used to support them in enterprise deployments.\r\nHave you used Visual Studio?\r\nHave you used Eclipse?\r\nWhat is a SAN, and how is it used?\r\nWhat is clustering, and describe its use?\r\nWhat is the role of the DMZ in network architecture?\r\n', '30 Min.', 'HR Interview', '1. Conversational skills were tested.\r\n\r\n2. Prioritizing things, situational questions were asked.\r\n', '30 Min.', 'NA', 'NA', 'NA', 'NA', 'Approved', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 18:53:23', 7, '2022', 'Eligibility criteria to be added\r\nThere were two profiles, only one is mentioned , check email from CRPC for resolution of it'),
(2, 18, 1, 'Rs. 9 LPA ', 'B.tech ', 'Product Engineer', 'Video making on a series of questions.', 'Video making on-\r\n\r\nWrite a program to print the pattern.\r\nWrite a program to check whether a number is prime or not.\r\nWrite a program to print first N prime number.\r\nWrite a program to print Fibonacci Series.\r\nWrite a program to count digits till N.\r\nWrite a program to print reverse of a number.\r\nWrite a program to print inverse of a string.\r\nWrite a program to rotate a number.\r\nWrite a program to find GCD & LCM of given numbers.\r\nWrite a program to find factorial of a number.\r\nWrite a program to check whether the given numbers are Pythagorean Triplet or not.\r\nWrite a program for the Curious Case of  Benjamin Bulb.\r\n', 'One Week', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'Approved', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 18:57:18', 7, '2022', '\r\n\r\nCapitalization error to be checked in \"Till\" Prime No. Till N\r\n\r\nJob description to be editted'),
(3, 19, 3, 'Rs. 7.37 LPA', ' Current Degree (B.Tech/MCA/M.Tech) - 70% without any backlog', 'Associate Software Engineer', 'Online Test', 'Coding and Aptitude Test.\r\nThis is an elimination round.\r\nQuestions were MCQ, Response and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related questions.\r\n*Aptitude, verbal ability and logical reasoning.\r\n*DBMS\r\n*Coding', '2 Hr.', 'Technical Interview', 'Explain what is Backbone.js collections ?\r\nIn databases, what is the difference between a delete statement and a truncate statement?\r\nWhat are transaction logs, and how are they used?\r\nWhat are the most important database performance metrics, and how do you monitor them?\r\nWhat development tools have you used?\r\nWhat languages have you programmed in?\r\nWhat source control tools have you used?\r\nWhat is a SAN, and how is it used?\r\nWhat is clustering, and describe its use?\r\nExplain what is Backbone.js router is used for ?\r\nExplain what is Backbone.js Models?\r\nWhat is model.attributes ?\r\nWhat is the function of toJSON ?\r\nMention what are the types of Notation used for Time Complexity?\r\nExplain how binary search works?\r\nExplain what is Skip list?', '30 Min.', 'HR Interview', '1. Introduce yourself. Why do you choose OPTUM? Do you have any location preference? Do you have any questions?\r\n2. Are you ready to relocate? What is your weakness and what are the ways to overcome it?\r\n3. What do you know about Optum?What are your strengths? How much marks you got in 10th,12th and your semester exams?\r\n4. What is the biggest challenge in your life and how will you overcome that challenge?\r\n\r\n', '30 Min.', 'NA', 'NA', 'NA', 'NA', 'Approved', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 19:15:18', 7, '2022', 'Introduce yourself. Why OPTUM? Location preference. Any questions?\r\n2. Ready to relocate? Weakness and ways to overcome it. \r\n3. How did you hear about Optum? Your strengths? your marks?\r\n4. Biggest challenge in life and how you overcome the challenge.\r\n\r\nFrame proper questions \r\nEligibility Criteria: Current Degree (B.Tech/MCA/M.Tech) - 70% without any backlog\r\n.Eligility :Tech (CSE, CS, CSI, IT, EC, EEE, EI), MCA, and M.Tech 2022 Batch Female students '),
(4, 4, 1, ' Rs. 2.16 LPA', 'B.Tech (ME) 2022', 'Service Advisor', 'Technical and HR Round', 'Technical Questions\r\n\r\n1. Explain 2-stroke and 4-stroke engine.\r\n2. What are the parts of engine cylinder?\r\n3. Difference b/w Diesel engine and Petrol engine.\r\n4. What will happen if water enters the engine cylinder?\r\n\r\nHR Questions\r\n\r\n1. Tell me about Yourself.\r\n2. Tell me about your Projects.\r\n3 .What do know about our Company?\r\n4. Sell me the Pen.\r\n5. Why should we hire you?\r\n6. Do you have any Questions?', '30 Min', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'Approved', 'NA', '2022-02-25 19:25:27', 7, '2022', 'Hr Questions\r\nCapital \"R\"\r\n\r\nCorrect as Tell about your projects.\r\n'),
(5, 20, 4, ' Rs. 19 LPA', 'B.Tech (CSE,CS,IT,CSI,EC)', 'Associate Software Engineer & Associate Analyst', 'Online Test', 'Coding and Aptitude test.\\n\r\nThis is an elimination round.\\n\r\nAll questions were MCQ-based.\\n\r\nThis round contains two sections.\\n\r\nSection 1-\r\nThis section contains Aptitude Questions.\\n\r\nSection 2-\r\nThis section contains Technical Questions related to the core.\\n\r\nQuestions from subjects like thermodynamics, material science, industrial management, and manufacturing mainly.\\n\r\nAptitude, verbal ability, and logical reasoning.\r\n', '2 Hr.', 'Coding', 'Questions based on AVL-Tree\\n\r\nQuestions based on Game Theory\\n \r\nQuestions based on OOP\\n\r\nQuestions based on DFS\\n\r\nQuestions based on Divide and Conquer\\n\r\n', '90 Min.', 'Technical Interview', 'TECHNICAL QUESTIONS\r\n\r\nQuestions based on OOPS concept.\r\nWhat is wrapper class in java?\r\nDefine Friend function in c++.\r\nWhat is Constructor and list its types.\r\nWhat is Dynamic polymorphism?\r\nDefine Constructor Overloading.\r\nTell me something about MongoDB.\r\nWhat is the difference between SQL and no SQL databases?\\n\r\nWhat are indexes? What are its uses ? Give a real-world example.\\n \r\nWhat is the primary key? What is a foreign key? What problems does foreign key solve? What are data anomalies? \\n\r\nWhat is a garbage collector in java? Can we explicitly call GC? What is the command for it? \\n\r\nWhat is a linked list? Difference between array and linked list.\\n \r\nGive an example of real-world programming where a linked list is used over an array.\\n\r\nWhat is JVM?\\n\r\nWhat are the latest technological trends and how are you keeping up with them?\\n \r\nPuzzle-type Questions.\\n\r\nWhat are pointers? Why Java doesn\'t support pointers?\\n \r\nWhat are dangling pointers and How do you fix them? \\n\r\nDiscussion about dynamic memory allocation (malloc, calloc, realloc).\\n \r\nWhat do you know about inheritance? What are multiple & multilevel inheritances?\\n  Why java doesn\'t support multiple inheritances?\\n \r\nWhat do you know about the Diamond problem?\\n\r\nGiven two unsorted arrays, explain an approach to merge them into a single sorted array. How will you sort a string? \\n\r\nWhat is LRU cache? \\n\r\nImplementation of Binary Search.\\n\r\nWhat is serialized and deserialized in python?\\n \r\nWhat are the operations that can be done on file and what are the methods or functions used to work on files in c++? \\n\r\nHow does the getLine() function work under the hood (c++)?\\n\r\nWhat is a firebase?\\n\r\nWhat is polymorphism? Code and give examples.\\n\r\nTell something about Project work and Internship experience.\\n \r\nDo you have any Questions?\\n', '30 Min.', ' HR Interview', 'Introduction about Lowe\'s.\\n\r\n\r\nTell me about some situations where you and your team member have conflicts and how did you deal with them.\\n\r\n\r\nWhat was the toughest decision of your life and what you had done that time?\\n\r\n\r\nWould you be able to switch your technology?\\n\r\nWhat is that one thing that you learned during your JEE MAINS preparation?\\n\r\n\r\nWhat is your project about?\\n\r\n\r\nWhat is competitive programming and why do you like it?\\n\r\n\r\nWhat do you prefer, virtual or offline work? \\n\r\nHow comfortable are you with the thought of relocation?\\n \r\n\r\nWhat do you like the most about our company?\\n\r\n\r\nWhat are the things you need to work on?\\n\r\n\r\nWhich project has been the closest to you and why? \\n\r\n\r\nTell me about your strengths and weaknesses.\\n\r\n\r\nWhat is your aim in life? \\n\r\n\r\nA situation-based problem , based on choosing between your learning, your earnings and the company.\\n\r\n\r\nWhat would you do if you don\'t get selected at Lowes? \r\n\r\nWhat would you do if you got selected at Lowes? \r\n\r\nDo you have any questions?\r\n', '30 Min.', 'NA', 'Approved', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2023-01-28 08:33:01', 7, '2022', NULL),
(6, 16, 3, '5-6LPA ', 'B.Tech (All Streams) and MCA 2022 Batch', 'Software Development Engineer', 'Online Test', 'Technical and Aptitude test.\r\nThis is an elimination round.\r\nAll questions were MCQ-based & Coding\r\n\r\nThis section contains Technical Questions related to Coding, some of them are given below:\r\nGraph\r\nTree\r\nSearching and Sorting\r\nMatrix\r\nString\r\nLinked-list \r\nDynamic Programming,\r\nBacktracking\r\nArray\r\nStack\r\nQueue\r\nHeap\r\n', '2 Hr.', 'Technical Interview', 'B.Tech (All Streams) and MCA 2022 Batch', '30 Min.', 'HR Interview', 'HR Questions:-\r\n\r\n\r\nWhy do we Hire you? \r\nIntroduce yourself. \r\nTell me about Onboarding Process.\r\nWhy do you want to join our company? \r\nHow do you choose the company if you will have another offer letter?\r\nAre you ready to relocate? \r\nTell me about the company. \r\nWhat’s the salary that you expect?\r\nQuestions about my Family.\r\nWhat qualities do you have that you haven\'t mentioned in your resume? \r\nHow are you better than others?\r\nWhat would you choose when compared between us and some other big company?\r\nWhich technology do you prefer and why? If we don\'t work with the technology you like, then what will you do?\r\nDo you follow the Olympics?\r\nSome basic questions related to me.\r\nAbout General  Behavioral questions.\r\nTechnology you would love to work in the future?\r\nSituation-based questions. \r\nProject-related questions.\r\nInternship related questions.\r\nWould you prefer a large-size company in your specific field or a mid-size company in some other technical field?\r\n', '30 Min', 'NA', 'NA', 'NA', 'NA', 'Pending Approval', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 19:47:46', 7, '2022', NULL),
(7, 21, 1, ' Rs.8 LPA', 'X - 80%, XIIth/Diploma - 80%, B.Tech - 80%', 'Product Engineering Intern', 'Online Test', 'Technical and Aptitude test.\r\nThis is an elimination round.\r\nAll questions were MCQ based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude, Arithmetic Reasoning, Quantitative Reasoning questions from time and work, distance and speed, Permutation & Combination, probability.\r\nSection 2-\r\nThis section contains Technical Questions related to Coding.\r\nGraph\r\nTree\r\nSearching and Sorting\r\nMatrix\r\nString\r\nLinked-list \r\nDynamic Programming\r\nBacktracking\r\nArray\r\nStack\r\nQueue\r\nHeap.\r\n', '2 Hr.', 'NA', 'na', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'NA', 'Pending Approval', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 20:01:23', 7, '2022', NULL),
(8, 22, 4, 'Rs. 5.50 LPA Stipend: Rs. 25k , Rs. 5.50 LPA Stipend: Rs. 25k & Rs 4.00 LPA Stipend: Rs. 20k    ', 'B.Tech (CSE, CS, CSI, IT, EC) and MCA 2022', 'GET , GBT (Blockchain) & GDT (UI/UX)', 'Online Test', 'Coding and Aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ, Response, and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related.\r\n*Aptitude, verbal ability, and logical reasoning.\r\n*DBMS\r\n*Coding', '30 Min.', 'Communication Test', 'Debate Topics\r\nHuman cloning should be legalized.\r\nAll drugs should be legalized.\r\nAnimal testing should be banned.\r\nJuveniles should be tried and treated as adults.\r\nClimate change is the greatest threat facing humanity today.\r\nViolent video games should be banned.\r\nThe minimum wage should be $15 per hour.\r\nAll people should have Universal Basic Income.\r\nSex work should be legal.\r\nCountries should be isolationist.', '20 Min.', 'Domain Test', 'What is SQL?\r\nTell about different search engines. \r\nName 5 cloud storage like Azure(Microsoft), AWS(amazon), Anthos(google). \r\nHave you worked on python and data analysis?\r\nArray and Dynamic-programming coding Questions.\r\nQuestions related to the OOPS concept and features of OOPS. \r\nCan we use int main()? \r\n\r\n', '90 Min.', 'Domain/HR', '1. Introduce yourself.\r\n2. Why do you choose McKinley Rice?\r\n3. How do you think you can be an asset to our company? \r\n4. What are your short-term and long-term goals? \r\n5. Where do you see yourself in 5 years? \r\n6. What are your hobbies (what do you do in your free time)?\r\n7. What are your weaknesses and strengths?\r\n', '30 Min.', 'NA', 'Pending Approval', 'https://www.geeksforgeeks.org/\r\nhttps://www.codechef.com/\r\nhttps://www.hackerrank.com/', '2022-02-25 20:12:57', 7, '2022', NULL),
(9, 23, 3, 'Rs. 8- 9 LPA ', 'B.Tech (CSE/CS/CSI/IT/EC)', 'Front-End Developer', 'Online Test', 'Aptitude Test and Pseudo Test \r\nAll questions were MCQ based. \r\nQuantitative aptitude and Verbal Ability\r\nTime Work  Distance Speed\r\nPermutations and Combinations \r\nProbability\r\nBlood relation\r\nPseudo Code\r\nLogical  Reasoning\r\nC Programming Questions\r\n', '1.5 Hr.', 'Coding Test', 'Questions based on AVL-Tree\r\nQuestions based on Game Theory \r\nQuestions based on OOP\r\nQuestions based onRecursion\r\nQuestions based onBit Magic\r\nQuestions based onBacktracking\r\nDynamic Programming\r\nQuestions based on DFS\r\nQuestions based on Divide and Conquer\r\n', '1.5 Hr.', 'Assignment', 'Assignment bases on Front-End', 'One Day', 'Technical/HR Interview', 'HR-Questions:\r\nTell me about yourself.  \r\nWhy do you want to join us? \r\nWhat did you see while applying to companies?  \r\nWhat if another company is willing to hire you for some other role on  a better package?  \r\nWill you be able to work for 9-10 hours?  \r\nHow you will handle a situation in a project team where your idea is  looking bad to other team members? \r\nWhat do you know about the company? \r\nWhat are your weaknesses and strengths? \r\nHow you will handle a situation where you don’t know something?\r\n\r\nTechnical Round-Questions:\r\nWhat is a promise?  \r\nWhat is async await?  \r\nHow to center a div inside a div?  \r\nTell me about Implementation of Set Timeout with promise in the given scenario. \r\nWhat are self-invoking functions and why are they used? \r\nWhat is event propagation? \r\nWhat is the closure?  \r\nWhat is hoisting?  \r\nWhat are semantic tags in HTML?  \r\nQuestions related to flexbox.  \r\nJavaScript concepts like promises, callback functions, prototypes.\r\nMade a to-do list in only HTML, CSS, and JS.  \r\nWhat are pseudo-elements in CSS? \r\nCSS Questions like - - center an element horizontally and vertically. - center with respect to a div. - use of media que