(34, 38, 3, '15.13 LPA', 'B.TECH', 'Software QA Engineer', 'Online Test', 'Coding and aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ, response and coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains aptitude questions.\r\nSection 2-\r\nThis section contains \r\n*coding and DBMS related questions.\r\n*Aptitude, verbal ability, and logical reasoning.\r\n', '2', 'Technical', 'B.TECH', 'N/A', 'HR  ', '1. Introduce yourself.\r\n2. What are your interests and favorite subjects?\r\n3. 3 puzzles:\r\na) What is the biggest number that can be formed using 4 1\'s?\r\nb) Three bulbs and switches problem.\r\nc) Programming approach for selecting 3 aces of our choice from a deck of 52 cards.\r\n4. Why did you opt for this profile?\r\n5. What are the checks that you will perform on the following to ensure whether they are up to your expectations or not?\r\na) Clothes ordered via online shopping sites.\r\nb) Computer monitor bought online.\r\n 6. Explain internship and hackathon projects.\r\n7. What are the challenges faced in projects?\r\n8. What does the term quality mean to you in any product?\r\n9. What are your weaknesses and strengths?\r\n10. Why should we hire you as an SQA engineer? What are the 3 qualities that make you best fit for this role?\r\n11. Define various test cases for a snake and ladder game.\r\n12. What is an approach in designing a DB schema?\r\n13. Having a good academic profile, why won\'t you go for higher studies? Do you have any questions for us?\r\n14. Where do you see yourself in 5 years?\r\n15. Few situation based questions.\r\n16. Tell us about your family background. Are you flexible to relocate?\r\n17. Why will you join the software assurance team if the dev part is good?\r\n', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 16:50:37', 5, '2022', NULL),
(35, 38, 3, '15.13 LPA', 'B.TECH', 'Software QA Engineer', 'Online Test', 'Coding and aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ, response and coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains aptitude questions.\r\nSection 2-\r\nThis section contains coding and DBMS related questions.\r\n*Aptitude, verbal ability, and logical reasoning.\r\n*DBMS\r\n*Coding', '2', 'Technical', '1. Queries related to SQL.\r\n2. What is atomicity in DBMS? \r\n3. What is a CSS selector?\r\n 4. What is SDLC and its phases?\r\n 5. What do you know about testing? \r\n6. What is the significance of each word in public static void main(String [] args) and System.out.println?\r\n 7. What are the various OOPS concepts?\r\n 8. Write the code to explain polymorphism. What are the different types of polymorphism? What is runtime polymorphism?\r\n 9. Is constructor overloading possible?\r\n 10. Programming approach to find whether a number is prime or not.\r\n 11. What is the URL and its full form? What are its parts? \r\n12. Differentiate between HTTP and HTTPS. \r\n13. What is the domain name in www.google.com?\r\n 14. What are the checks that you will perform for analyzing the performance of a coffee machine?\r\n ?15. What is the margin property syntax in CSS?\r\n16. Explain public static void main in Java?.\r\n17. Can we use int main()? \r\n18. What is String args[] in the main function? \r\n19. What is inheritance and why do we need to use it?\r\n20. What are access specifiers? Explain it all. \r\n21. Write a program to calculate N^K.\r\n22. What are constructors? Define its types with code.\r\n23. Differentiate between drop and truncate command.\r\n24. Explain types of join with examples.\r\n25. What are primary and foreign keys?\r\n26. What are threads? How do we use them in Java? \r\n27. Explain the meaning of the line \"A b = new B()\". \r\n28. Define test cases for a calculator which can perform only 2 operations, addition and subtraction.\r\n 29. What are the SQL operations you performed in your project? \r\n30. Some output-based questions.\r\n31. Provided 2 sets of codes, had to identify them as static or dynamic polymorphism.\r\n32. Provided 2 sets of codes had to check whether the parent/child class statement would be running?\r\n 33. Code the Java program to check for the palindrome string.\r\n34. Explain software engineering and the software development life cycle. \r\n35. What are the types of testing used during product development and its launching?\r\n36. Provided 2 database tables, had to extract data from it where the provided conditions satisfy.\r\n', 'N/A', 'HR  ', '1. Introduce yourself.\r\n2. What are your interests and favorite subjects?\r\n3. 3 puzzles:\r\na) What is the biggest number that can be formed using 4 1\'s?\r\nb) Three bulbs and switches problem.\r\nc) Programming approach for selecting 3 aces of our choice from a deck of 52 cards.\r\n4. Why did you opt for this profile?\r\n5. What are the checks that you will perform on the following to ensure whether they are up to your expectations or not?\r\na) Clothes ordered via online shopping sites.\r\nb) Computer monitor bought online.\r\n 6. Explain internship and hackathon projects.\r\n7. What are the challenges faced in projects?\r\n8. What does the term quality mean to you in any product?\r\n9. What are your weaknesses and strengths?\r\n10. Why should we hire you as an SQA engineer? What are the 3 qualities that make you best fit for this role?\r\n11. Define various test cases for a snake and ladder game.\r\n12. What is an approach in designing a DB schema?\r\n13. Having a good academic profile, why won\'t you go for higher studies? Do you have any questions for us?\r\n14. Where do you see yourself in 5 years?\r\n15. Few situation based questions.\r\n16. Tell us about your family background. Are you flexible to relocate?\r\n17. Why will you join the software assurance team if the dev part is good?\r\n', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-17 00:00:00', 5, '2022', NULL),
