(37, NULL, 3, 'For positions 1 and 2: Rs 10.00 - Rs. 12.00 LPA  &  For Position 3,Position 4 , Position 5: Rs. 6.00 LPA', 'Engineering students from all branches pursuing their third year (2022 pass outs)', 'Position 1: UI _FP , Position 2: SDE _FP , Position 3: TPA (Backend, Frontend, Data and SRE role.) , Position 4: Security Engineer , Position 5: System Engineer', 'Online Test', 'Hiring flow: for position 1 and 2\r\nPart 1:\r\n1) Online Test, Programming - 90 Mins ( They can code in any programming language)\r\n3) Result will be announced on the same day\r\n4) Based on the results, shortlisted candidates will be sharing their resume and will have an initial discussion with HR for further shortlisting.\r\nPart 2: \r\n1) Technical interview (can be telephonic, skype, video call) (not mandatory)\r\n2) The students selected in the interview process at the campus will be invited to \"Juspay virtual Hackathon Challenge\", for final selection, which will be conducted (1-2 day process)\r\n \r\nHiring flow: for position 3 - TPA - Backend / Frontend / SRE: \r\n1. Online Assessment \r\n2. Learnathon - Learn-a-thon will be a two-day discussion-based round which will be based on problem-solving, logical, analytical abilities, and working around problem statements through coding/ discussing, deriving formulas from the codes. (we will be sharing learning material for the same in advance)\r\n3. 1st Interview  / Discussion\r\n4 . Final Interview\r\n \r\nHiring flow: for position 3 - TPA - Data\r\n \r\n1. Online Assessment (Data test on MCQ\'s)\r\n2. Datathon - Analytical round ( learning material will be shared)\r\n - Datathon will be a discussion-based round which will be based on problem-solving, logical, analytical abilities, and around building a dashboard (we will be sharing learning material).\r\n3. 1st Interview  / Discussion\r\n4 . Final Interview\r\n \r\nHiring flow: for Position 4 - Security Engineer \r\nOnline Assessment\r\n2. Learnathon - Learn-a-thon will be a two-day discussion-based round which will be based on problem-solving, logical, analytical abilities, and working around problem statements through coding/ discussing, deriving formulas from the codes. (we will be sharing learning material for the same in advance)\r\n3.    Final Interview\r\n \r\n \r\nHiring flow: for Position 5 - System Engineer \r\n1.    Online Assessment\r\n2.    Hackathon - Hack-a-thon will be a whole day process to evaluate the Problem Solving, Logical thinking, System and Coding skills by working around the problem statements. \r\n3.    1st Interview\r\n4.    Final Interview\r\n', '0', 'Technical Interview', 'Technical Question\r\n 1. Data Structure and Algorithms questions.\r\n 2. Is Binary tree a Binary search tree?\r\n 3. Stock span problem.\r\n 4. What is N-array tree?\r\n 5. How to indent the JSON object?\r\n 6. Develop an analogue clock using Javascript.\r\n 7. How to find the depth of an array tree.\r\n 8. How to traverse an n-ary tree?\r\n 9. Diameter of an n-ary tree.\r\n 10.Level order traversal for the n-ary tree.\r\n 11. Construct a tree and find the depth where the maximum no. of nodes are present.\r\n 12.Purescript to rotate a cube.\r\n 13. N Queen Problem .\r\n 14. Questions Related to DBMS.\r\n 15. OOPs, concept questions.\r\n 16. Students will be expected to write codes in the interview.\r\n 17. You may be asked puzzles in this round.\r\n 18. Basic Questions related to your favourite subject in school and some questions related to the data field.', 'NA', 'HR Interview', '1. Tell me about yourself.\r\n2. Why JUSPAY?\r\n3. Where do you see yourself five years from now?\r\n4. What are your strengths and weaknesses?\r\n5. Questions from resume.\r\n6. Any questions from me?\r\n      7. How do you like juspay hiring process?\r\n', 'NA', 'NA', 'na', 'NA', 'na', 'Pending Approval', 'na', '2022-02-17 00:00:00', 7, '2022', NULL),
