(60, 67, 4, ' 3.56 LPA', 'B.TECH,MCA', 'SOFTWARE DEVELOPER', 'Online Test', 'Coding and aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains aptitude questions.\r\nSection 2-\r\nComputer fundamentals.', '2', 'Technical', 'B.TECH,MCA', 'N/A', 'Technical', '1.Questions regarding current technologies.\r\n2.  Define blockchain. \r\n3. Explain OOPs concept. \r\n4. Explain your projects and your role in it. \r\n5. What is static and dynamic memory?\r\n6. Questions from resume.\r\n7. Basic knowledge of programming.\r\n8. What is the law of thermodynamics, Hooke\'s law and pitting?\r\n9. What are built-in data types with their uses?\r\n10. What is a string and how to find the length of the string? \r\n11. What is your favorite subject?\r\n12. Tell me something about yourself.\r\n13. How do your skills help us? \r\n14. Explain about your internship. \r\n15. Tell me something about your achievements. \r\n16. Explain your conference paper.\r\n17. Asked questions related to projects.\r\n18. Coding related questions.\r\n19. Asked some questions related to DS. \r\n20. Java questions and questions related to teamwork.\r\n21. What is the scope in Python and why is it better?\r\n22. Differentiate between C and C++, inheritance and polymorphism.', 'N/A', 'HR', '1. Introduce yourself. \r\n2. Who is the current CEO and CFO? \r\n3. Who was the previous CEO and CFO?\r\n4. Why do you want to work with TCS? \r\n5. Why should we hire you?\r\n6. How was your technical round?\r\n7. What are the programming languages you know?\r\n8. Are you aware of the 1 year bond?\r\n9. How much time will you take to learn Java?\r\n10. Where is the headquarters of TCS?\r\n11. Tell me something about yourself like family background, future goals, strengths and passion.\r\n12.. Are you able to reallocate?\r\n13. What do you know about TCS?\r\n14. Why do you want to join TCS as you are from an electrical background?\r\n15. Questions about backlogs and marks.\r\n16. Some questions related to the training period.\r\n17. One of the scenario based questions - On a particular day, I have to submit the important task in the office whereas on the other hand I was invited to the party by my friend whom I hadn\'t met for a long time.  What is the priority according to me?', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 17:17:18', 5, '2022', NULL),
(61, 68, 3, '5 LPA', '60% B.tech', 'Engineer Traine', 'Coding and Aptitude test.', 'Coding and aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ, Response and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related.\r\n*Aptitude, verbal ability and logical reasoning.\r\n*DBMS\r\n*Coding\r\n', '2', 'INTERVIEW', '60% B.tech', '20 Min', 'INTERVIEW', 'Introduction\r\nSimple conversation\r\nHow you dealt with problems\r\nProject and Internship related \r\nStrength and weakness\r\nDo you want to do something for social benefits?\r\nSituation based questions\r\nAbout leadership qualities\r\nHow will you resolve a conflict in your team?\r\nHow easily you can make good bonding with your seniors in your workplace.\r\nRecent fight with your friend.\r\nLet\'s assume, you have to organize an event in college but don\'t know anything about it, what will you do? Or how will you organise?\r\nWhat will you do after getting negative feedback or criticism?\r\nTell me something about your club? 5 points which make it different from other clubs or societies?\r\nAre you ok with the service agreement of 1 year?\r\nWhat will you do if your teammates on your final year project haven\'t completed their tasks and the deadline is near? \r\nMainly resume based questions. Hobbies, interests, family background.\r\n', '20 Min', 'N/A', 'N/A', 'N/A', 'N/A', 'Rejected', 'N/A', '2022-02-24 17:58:31', 4, '2022', NULL),
(62, 3, 3, 'Rs. 3.97 LPA, Rs. 3.55 LPA', 'N/A', 'Developer, Quality Analyst', 'Online Test', 'This is an elimination round.\r\nSection 1:-\r\nTechnical Question related to Coding.\r\ngraph, tree, search and sorting, matrix, string, linked-list, \r\ndynamic-programming, backtracking, array, stack, queue and heap.\r\n', '0', 'Technical Interviews', 'Technical Round:\r\n\r\n\r\n1. Project-related questions\r\n\r\n2. Define array.\r\n\r\n3. What is Django MVT structure?\r\n\r\n4. Difference between Mongo DB and My-SQL\r\n\r\n5. How will you handle duplicate elements in Quicksort?\r\n\r\n6. Define cross join? Difference between cross join and inner join?\r\n\r\n7. What is the primary key?\r\n\r\n8. What is a secondary key?\r\n\r\n9. Define Data Types(byte, char, bit, nibble, etc).\r\n\r\n10.OOPS, Concept .\r\n\r\n11.Code: Reverse the places of word string and capitalize them\r\n', 'N/A', 'HR-Interviews', 'HR-Round:\r\n\r\n\r\n1. On what technology would you like to work?\r\n\r\n2. Why should we hire you?\r\n\r\n3. What are your strengths and your weaknesses?\r\n\r\n4. Brief about your Project? \r\nWhat were the challenges faced by you?\r\n\r\n5. Conversation about college and life in general.\r\n\r\n6. Where do you see yourself after 5-years?\r\n\r\n7. About resume.\r\n\r\n8. About internships. \r\n', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 00:00:00', 11, '0', NULL),
(63, 14, 3, 'Rs. 3.50 LPA', 'N/A', 'N/A', 'Online Test', 'This is an elimination round.\r\nQuestions were MCQ, Response and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related.\r\n*Aptitude, verbal ability and logical reasoning.\r\n*DBMS\r\n*Coding\r\n', '0', 'Technical ', '1.Simple java questions- Exception handling, thread, Polymorphism, Access Modifiers, Database connectivity (JDBC).\r\n2.DS questions like Array.\r\n3.Questions based on Resume.\r\n4.Function overloading, function overriding.\r\n5.Sorting\r\n6.Factorial\r\n7.Data types\r\n8.Oops concepts\r\n9.Python features \r\n10.C features \r\n11.Project and internship-related questions.\r\n12.Pointers\r\n13.String, char and double datatype.\r\n14.Explain any program. \r\n15.Laws of thermodynamics.\r\n16.Machine learning, AI, and about microprocessor\r\n17.What is typecasting in C?\r\n18.When should we use typecasting?\r\n19.Logic to swap two numbers.\r\n20.What is python? Basic questions regarding python.\r\n21.Why do you want a job in a different domain from ECE? \r\n22.HTML or CSS.\r\n23.Diode and Transistor, CMOS.\r\n24.How to attain abstraction in your code? \r\n25.Why did you choose CPP as your language?\r\n26.Name any 5 languages which are popular recently?\r\n27.Recent technological advancements in the IT Industry.\r\n28.Cloud computing questions (its types).\r\n29.SQL\r\n30.Difference between interpreter and compiler?\r\n31.Does Java use an interpreter or compiler?\r\n32.What are the fundamentals of oops and is java oops language?\r\n33.What is the difference between C++ and Java on the basis of the oops concept?\r\n34.Which programming language do you prefer? \r\n35.What is Primary Key and Unique Key? \r\n36.What is DBMS? \r\n37.Why is Java better than C and C++ tell 10 points?\r\n38.Do pointers exist in java and python?\r\n39.What is a function and what is a procedure? Write any code to implement it?\r\n40.What is an operating system?\r\n41.What are the commands you know in Linux or Microsoft for OS?\r\n42.What is packaging and indexing in SQL?\r\n43.What is call by value and call by reference? \r\n44.What type of Language is C? Features of C language?  \r\n45.Difference between DBMS & RDBMS? \r\n46.What are Exceptions in Java? Explain Its Types.\r\n47.WAP in java to count no duplicate characters in a string and print them.\r\n48.WAP in java to find the middle element of an array after sorting using insertion sort. \r\n49.What is your favorite subject?\r\n50.What is Recursion?\r\n51.Have you ever connected the java frontend with the backend?\r\n52.String palindrome.\r\n53.Difference between array and pointer\r\n54.Second maximum in array.\r\n55.WAP to convert decimal to binary?\r\n56.What is the difference between put and printf?\r\n57.Is function overloading supported in c?\r\n', 'N/A', 'HR-Interviews', '1.Introduction.\r\n2.Simple conversation.\r\n3.Query regarding bond.\r\n4.Which programming language are you comfortable with?\r\n5.Reallocation\r\n6.How do you deal with problems?\r\n7.Why do you want to join Wipro, the best moment in college, about your locality, best places to visit?\r\n8.Project and Internship related.\r\n9.Strength and weakness.\r\n10.Any backlog or education gap?\r\n11.Do you want to do something for social benefits?\r\n12.Situation-based questions.\r\n13.About leadership qualities.\r\n14.How will you resolve a conflict in your team?\r\n15.How easily can you make good bonding with your seniors in your workplace?\r\n16.Recent fight with your friend.\r\n17.Let\'s assume, you have to organize an event in college but don\'t know anything about it, what will you do? Or how will you organize?\r\n18.What will you do after getting negative feedback or criticism?\r\n19.Tell me something about your club? 5 points which make it different from other clubs or societies?\r\n20.Are you ok with the service agreement of 1 year?\r\n21.What will you do if your teammates of the final year project haven\'t completed their tasks and the deadline is near? \r\n22.Mainly resume-based questions- Hobbies, interests, family background.\r\n23.If your team members are extremely busy, how will you complete your project?\r\n24.What are your subjects of interest?\r\n25.On which technology you have worked upon?\r\n26.The scenario where you worked as a team.\r\n27.Did you face any conflicts, if so, how did you solve them?\r\n28.Difficulties faced with teammates, any team collaboration?\r\n29.Why do you want to come into IT from Mechanical? \r\n30.What is that problem you faced in your college life and you came up with a creative solution? \r\n31.Do you like working individually or are you a team player?\r\n32.Why should we hire you? \r\n33.Where do you see yourself in 5 years? \r\n34.Your preferred location? \r\n35.What did you lose with your weakness and how did you overcome it?\r\n36.Have you ever given any presentations?\r\n37.If you could not solve any problem? What would be your next approach to solve that problem?\r\n38.Where did you get to know about this position? \r\n39.Have you applied earlier to any company? \r\n40.Tell me something about WIPRO? \r\n41.Your Negative Strength. \r\n42.Leadership skills.\r\n43.Achievements.\r\n44.If you could not solve a problem on the 1st go. What would be your next strategy to solve that problem?\r\n45.Short-term and long-term goals.\r\n46.The interviewer discussed the resume only on extracurricular activities (when and where have you learned the activity, & description of what you achieved).\r\n', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 19:34:43', 11, '0', NULL),
(64, 15, 3, 'Rs. 6.50 LPA', '60% throughout', 'Full Stack Developer', 'Online Test', 'Aptitude test.\r\nAll questions were MCQ-based.\r\nQuantitative aptitude and Verbal Ability, Time Work Distance Speed, Permutations and Combinations Probability, Blood relation. \r\n\r\nQuestions: 20', '20', 'Technical ', '1. Dynamic Programming Stack Queue Array Linked list.\r\n2. Sorting \r\n3. Searching\r\n4. What are Constructor and Destructor is OOPs?\r\n5. Basics questions on bootstrap.\r\n6. Write a Program to find the second maximum in an array.\r\n7. Project-related questions.\r\n8. Write a program to find an unsorted subset of a semi-sorted array.\r\n9. What is Distributed Computing? About Cloud, OOPS, SQL. \r\n10. Space Complexity and its approach on a queue with a linked list.\r\n11. What are the type of sorting and where is it used?\r\n12. What is an abstract class? \r\n13. What is an IDE (Integrated developed environment)?\r\n', 'N/A', 'HR-Interviews', '1.About the Company.\r\n2.Why should we hire You?\r\n3.Where do you see yourself 5 years from now?\r\n4.Are you comfortable relocating to a different city?\r\n5.What technical skills do you have?\r\n', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 00:00:00', 11, '0', NULL),
(65, 37, 3, 'Rs. 4 LPA', 'N/A', 'N/A', 'N/A', 'Percentage Screening\r\nEnrollment Form\r\n\r\n', '0', 'N/A', 'Platform\r\nHireVue (Online platform for virtual video interviewing, recruiting and hiring)\r\nMode: \r\nOnline video-based assessment\r\nType: Elimination Round\r\n\r\nPractice (optional):\r\n3 questions (3mins for question + 3 mins for answering)\r\nMultiple retakes to get accustomed to the platform.\r\nQuestion level - easy.\r\nMain Test:\r\n3 questions (3mins for question + 3 mins for answering)\r\nOnly two attempts were allowed.\r\nQuestion level: Moderate\r\n1 Technical Question + 2 Situation-Based Questions (Case study)\r\nNote: \r\nTechnical questions can be from any other branch. (ME, EEE, EI)\r\nSet A: \r\nA warehouse is located 40 km from the production unit. State the advantages and disadvantages of the same. \r\nDuring COVID-19 the production unit of Sanitizers and Disinfectants is in the contamination zone. How would you manage the workers’ shift? \r\nQuestion related to Boilers by using supplementary fuel, cost-cutting, and efficiency.\r\nA production centre is relocated 40km away from the current centre. What factors will it cause on the production and how will you manage the effects faced by the various workers working at that centre?\r\n\r\nSet B:\r\n10k trucks are managed by a third party to facilitate movement between production units and warehouses. Suggest a way to get cost-cutting and better efficiency. .\r\nQuestion related to Boiler by using supplementary fuel, cost-cutting and efficiency. \r\nA boiler has a steam capacity of 4tons/hr. We have a biomass of 12 tons which can produce 40 tons of steam. As a byproduct methane gas is coming out of the system which is highly utilized for heating the water for making an efficient system. Find the amount of energy produced by the secondary medium and the cost-effectiveness.\r\nGiven-\r\nGCV of methane = 55530 kJ/kg, GCV of biomass = 15170 kJ/kg, Volume of methane gas = 500m3, Cost of biomass = Rs 5.2/kg \r\n\r\n\r\n\r\n\r\n\r\nSet C:\r\nWhat is the impact of the covid-19 pandemic on FMCG companies? How do you increase productivity? Give possible reasons.\r\nHow will you improve the security of our drivers who work on long projects? Give an example considering the 6 sigma principle.\r\nA numerical of a power plant. In which we have to calculate the amount of energy-saving and saving amount per year.\r\nA hair care product has launched successfully in the USA. For launching the same product in India, which marketing strategies should be applied?\r\n\r\n\r\n\r\n', 'N/A', 'N/A', 'Platform:\r\n MS - Teams (Link shared via mail after confirmation overcall)\r\nMode: Online video-based assessment\r\nType: Elimination Round\r\nPanel: 1 Assessor allotted (2 assessors present for 2 candidates)\r\nDuration: 30 min allotted slot (Avg. time – 17-18 min)\r\nAssessment: HR\r\nIntroduce yourself.\r\nWhy HUL?\r\nWhere do you see yourself 5 years down the line?\r\nIf work assigned to you is not related to instrumentation, then how will you tackle that, will you agree to work?\r\nQuestion level: easy to moderate.\r\nYou are in charge of a production unit’s night shift. During a tea break at night, workers show anomalous behavior and refuse to work stating that the tea is not good. How will you manage the situation in absence of your seniors?\r\nYou are in charge of a production unit’s night shift. During the night a machine develops an electrical fault. Knowing the severity of the fault, if you run the machine it might catch fire and the lives of workers could be at risk. However, this has not happened in past years. Shutting down the production might incur losses worth crores. What will be your response and how will you manage the situation?\r\nAre you willing to work night shifts?\r\n\r\n\r\n\r\nTechnical:\r\nIt consists of the major part of the interview.\r\nQuestion level – moderate to hard.\r\nQuestions based on basic knowledge from the branch.\r\nQuestions from Study subjects, Project, Industrial Visit, and Internship.\r\nMajor subjects covered in the interview were Industrial Measuring Instruments, Sensors, and Transducers. (from EI branch)\r\nWhat is the functioning of Ammeter? Why can’t we use it in parallel?\r\nDo you know about the Galvanometer? On which principle does it work? Also, explain its functioning.\r\nWhat is a Potentiometer? Explain its types, functions, and industrial applications.\r\nDo you know about Thermocouples? Explain its principle.\r\nRelation between deflecting torque and controlling torque.\r\nWhat are resistance, inductance, and capacitance? What are their units?\r\nWhat are transducers? What are its types?\r\nWhat do you understand about inverse transducers?\r\nQuestions related to project work-\r\nQuestion-based on components of the project.\r\nExplain the functioning of Servo motors. What are its industrial applications?\r\nWhat are motors? What do you understand about stepper motors?\r\nWhich motor is used in a 3D printer?\r\nWhat are Flex Sensors? How have you used them to copy hand gestures?\r\nQuestions based on Industrial Visit-\r\nWhich place and departments of the place you visited?\r\nWhat were the measuring instruments you observed?\r\nWhat were the safety measures used in boilers?\r\nMore emphasis on practical and applications aspects than theory.\r\nQuestions are asked in succession to the answer given.\r\nNo cross questionings, questions were more of a rapid-fire type.\r\nNote: Technical question tests in-depth knowledge of candidates with practical and applications-based concepts.\r\n\r\n\r\n\r\n', '30 MIN', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-25 00:00:00', 11, '0', NULL);
