INSERT INTO `company` (`companyID`, `companyName`, `companyClass`, `companyDescription`, `companyEstablishment`, `companyWebsite`, `companyAddDate`, `companyAddedBy`) VALUES
(1, 'ACCENTURE', 1, 'Accenture is an Irish-based multinational professional services company that specializes in IT services and consulting. A Fortune Global 500 company, it reported revenues of $44.33 billion in 2020 and had 569,000 employees. In 2015, the company had about 150,000 employees in India, 48,000 in the US, and 50,000 in the Philippines. Accenture\'s current clients include 91 of the Fortune Global 100 and more than three-quarters of the Fortune Global 500.', '1989', 'https://www.accenture.com/', '2022-01-27 00:00:00', 2),
(2, 'CDK Global Corporation', 4, 'CDK Global Inc. is an American multinational corporation based in Hoffman Estates, Illinois, providing data and technology solutions to the automotive, heavy truck, recreation, and heavy equipment industries', '2014', 'www.cdkglobal.com', '2022-01-27 00:00:00', 2),
(3, 'ION ', 3, 'ION Group is a privately held, global financial software and data firm that provides technology for trading and execution, risk management and position calculation, connectivity to exchanges and markets, and technology for middle and back-office processes. The firm offers its software across most asset classes and works with trading and brokerage firms, multinational corporations, governments, and central banks.', '1999', 'https://iongroup.com/', '2022-01-27 00:00:00', 2),
(4, 'KULIZA', 4, 'Kuliza is a leading provider of digital transformation and operational intelligence solutions for financial enterprises. Since 2006, Kuliza has executed more than 120 digital transformation projects for global startups and industry-leading global enterprises. Lend. In is Kuliza’s flagship lending product, The low code lending suite for banks and lending institutions to increase the overall efficiencies while decreasing the cost and go-to-market time for customers. The idea to scale, evolve, and continuously improve loan processing by leveraging the customer-centric design and new-age technologies is brought live using Lend.', '2006', 'www.kuliza.com', '2022-01-27 00:00:00', 2),
(5, 'First American India', 1, 'Title insurance', '1909', 'Www.fai.org', '2022-01-27 00:00:00', 2),
(6, 'ssbfsk', 4, 'sfaadasfs', 'vkvkkj', 'bsdaj', '2022-01-30 00:00:00', 4),
(7, 'AMAZON', 3, 'Amazon is an American multinational technology company that focuses on e-commerce, cloud computing, digital streaming, and artificial intelligence. It is one of the Big Five companies in the U.S. information technology industry. The company has been referred to as \"one of the most influential economic and cultural forces in the world\", as well as the world\'s most valuable brand. Amazon is known for its disruption of well-established industries through technological innovation and mass scale. It is the world\'s largest online marketplace, AI assistant provider, live-streaming platform, and cloud computing platform as measured by revenue and market capitalization. Amazon is the largest Internet company by revenue in the world.', '1994', 'https://www.amazon.com/', '2022-02-01 00:00:00', 2),
(8, 'OPTUM', 4, 'Optum is a health information technology and services firm that is part of UnitedHealth Group. It provides technological, operational and consulting solutions and services to individuals, healthcare organizations, pharmaceutical companies as well as the federal and state governments. Optum has been operating in India since 2006 and has teams supporting health care operations, product development, automation, analytics and data solutions.', '2006', 'https://www.optum.in/', '2022-02-01 00:00:00', 4),
(9, 'Adani Power', 2, 'Adani Power is leading industry in India', '2000', 'https://adani.com', '2022-06-23 13:58:00', 4);
INSERT INTO `companydatadivided` (`dataID`, `companyID`, `companyNumOfRounds`, `companyCTC`, `companyEligibility`, `companyJOBProfile`, `companyFirstRoundName`, `companyFirstRoundDescrip`, `companyFirstRoundDuration`, `companySecondRoundName`, `companySecondRoundDescrip`, `companySecondRoundDuration`, `companyThirdRoundName`, `companyThirdRoundDescrip`, `companyThirdRoundDuration`, `companyFourthRoundName`, `companyFourthRoundDescrip`, `companyFourthRoundDuration`, `companyAdditionalRoundDescrip`, `companyReportApprovalStatus`, `companyPracticeDetails`, `companyReportAddDate`, `companyReportAddedBy`, `companyReportYear`, `reportFeedBack`) VALUES
(1, 1, 2, '4.5 LPA,6.5LPA', '60% B.tech', 'Engineer Traine', 'Aptitude test', 'This is an elimination round.\r\nQuestions were MCQ, Response, and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS-related questions.\r\n', '2', 'TR+HR', 'TECHNICAL QUESTIONS\r\n1. OOPs concept \r\n2. DBMS SQL queries \r\n3. Data Structures \r\n4. Sorting \r\n5. Searching \r\n6. Questions related to project and internship \r\n7. Array \r\n8. Pointers  \r\n9. What are AI, ML, and IoT? \r\n10. What was your project? \r\n11. What are your favorite and unfavorite subjects and why? \r\n12. What is Machine Learning? \r\n13. Difference between Deep Learning and Machine Learning? \r\n14. Basic Questions from JAVA. \r\n15. What is the advantage of python over other languages? \r\n16. What is object-oriented language? \r\n17. What is an object? Explain encapsulation. \r\n18. What is Distributed Computing, about Cloud, OOPS, SQL \r\n19. Write a program to find out prime factors of a given number in whichever programming language you are comfortable with. \r\n\r\nHR Questions\r\n\r\n1. Have you managed something in your college? \r\n2. What were the difficulties faced while leading a team? \r\n3. Why do global certification? \r\n4. Why do you wish to join us being an ECE student? \r\n5. Most disliked subject & why? \r\n6. Won\'t you feel bad if you join us & your ECE academics are going in vain? \r\n7. Can you use any ECE subject/technologies to help us improve? \r\n8. Your strongest strength. \r\n9. How will you dissolve an issue in a group/team being a team leader? \r\n10. Most challenging task being a leader? \r\n11. Introduce yourself.\r\n12. What changes do you observe in the physical mode of communication and online mode of communication during a lockdown?\r\n13. How do you discuss project ideas with your seniors and batchmates in online mode? \r\n14. Tell something apart from your project work, where you work in teams, what skills you learn there?\r\n15. What difficulty do you face working in a team? \r\n16. Which is your favorite and least favorite subject? \r\n17. What is your greatest achievement? \r\n18. Which is your least favorite subject? \r\n19. What is Innovation according to you? \r\n20. Share about your family? \r\n21. Situation based questions mostly on Team Management \r\n22. What do you know about Accenture? \r\n23. Why should we hire you? \r\n24. Do you have any questions? \r\n25. Questions about academics. \r\n26. Question about branch change from Mechanical to CSE. \r\n27. Would you like to relocate?\r\n28. What is important to you, work or money? \r\n29. What is your thought about social networking in day-to-day life? \r\n30. What is your weakness? \r\n31. Why do you want to get employed in IT? \r\n32. What are your strengths and weaknesses? \r\n33. Where do you see yourself in the next 5 years? \r\n34. In all over India, which places have you already visited and want to visit? \r\n35. What are your hobbies?\r\n', '20 Min', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-01-30 12:51:55', 2, '2022', 'GRAMMER'),
(2, 2, 3, '16 LPA', '70% B.tech', 'Software Developer', 'Aptitude test', 'Aptitude test.\r\nAll questions were MCQ-based.\r\nQuantitative aptitude and Verbal Ability\r\nTime Work Distance Speed, Permutations and Combinations Probability, Blood relation', '3', 'Coding ', '70% B.tech', '2 ', 'TR and HR', 'Technical Round -Questions\r\n\r\nDefine OOPS, Inheritance, Class in C++, Data Types in C++\r\nDefine SQL Queries, DBMS\r\nSorting Technique along with their time complexities\r\nRecursion, Factorial Program Recursive\r\nDynamic Programming\r\nSynchronization, Thread\r\nProject Written on Resume\r\n\r\nHR-Questions\r\n\r\n\r\nIntroduction\r\nabout Company.\r\nWhy should we hire You\r\nWhere do you see yourself 5 years from Now\r\nAre you comfortable in relocating to a different city\r\n', '20 Min', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-01-29 08:42:54', 2, '2022', NULL),
(4, 3, 4, '11 LPA', '60% B.tech', 'Engineer Traine', 'Aptitude test', 'his round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related.\r\nAptitude, verbal ability, and logical reasoning.\r\nDBMS\r\n', '1', 'TECHNICAL ROUND', '60% B.tech', '20 Min', 'HR', 'Situation-based question. \r\nIntroduce yourself \r\nCase study \r\nWhy do you want to work in a non-tech profile?\r\n', '20 ', 'HR', 'Situation-based question. \r\nIntroduce yourself \r\nCase study \r\nWhy do you want to work in a non-tech profile?\r\n', '20 ', 'N/A', 'Pending Approval', 'N/A', '2022-01-29 08:43:41', 2, '2022', NULL),
(5, 4, 3, '6 LPA', '60% B.tech', 'Engineer Tranie', 'Coding and Aptitude test.', 'Coding and aptitude test.\r\nThis is an elimination round.\r\nQuestions were MCQ-based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nComputer fundamentals.\r\n', '2 hrs', 'TR and HR', '60% B.tech', '20 Min', 'HR', 'HR Questions\r\n\r\nIntroduce yourself \r\nWhy we should hire you\r\nWhat are the programming languages you know?\r\nSome questions related to the training period.\r\nHow do your friends describe you?\r\nWhat are the negatives or things you can improve in yourself?\r\nHow much time will it take you to learn JAVA?\r\nThe biggest challenge in life and you overcome the challenge.\r\nTell me about your major project. \r\nWhat are your hobbies?\r\n', '20 Min', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-01-29 09:06:54', 2, '2022', NULL),
(6, 5, 3, '4.5 lpa', 'Btech', 'Trainee', 'Gd', 'Gd', '1', 'Tech', 'Tech', '2', 'Hr', 'Hr', '3', 'Na', 'Na', 'Na', 'Na', 'Pending Approval', 'Try', '2022-01-27 00:00:00', 2, '2022', NULL),
(7, 6, 0, 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', '0', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Rejected', 'N/A', '2022-01-30 12:53:18', 4, '2022', NULL),
(8, 7, 2, '44 LPA', 'N/A', 'Engineer Tranie', 'Online Test', 'Coding and aptitude test. This is an elimination round. Questions were MCQ, Response, and Coding based. This round contains two sections. Section 1- This section contains Aptitude Questions. Section 2- This section contains Coding & computer fundamentals related questions. Computer fundamentals Coding', '2', 'INTERVIEW', 'Clone a linked list.\r\nBinary Trees.\r\nCoin Exchange (DP). \r\nIslands Problem (Graph).\r\nFlatten a multilevel Linked List. \r\nFind the common elements in three sorted arrays. \r\nSearch in right rotated sorted array \r\nReturn the right view of a Binary Tree.\r\nThe strongly connected component in the grid.\r\nStack and queue.\r\nHeap top k question\r\nOne behavioral question \"Describe a situation when you have to learn a completely new technology, how would you handle such a situation?\"\r\nIntroduction.\r\nPopulate the next pointer in the binary tree. \r\nLength of the longest substring with distinct character. \r\nInternship and projects.\r\nRotate the linked list clockwise by k .\r\nIndex of elements gives given difference. \r\nFind the height of the tree but the tree is not a simple binary tree there is a doubly-linked list inside the tree.\r\nGiven string s and k you have to remove contiguous k characters from string but after removing if there is any character that continuously occurs for k time you have to remove that also. Should do in O(n).\r\nInput: uxaabbbaxxh, k=3 -. uxaaaxxh uxxxh uh So final string would be? \r\nGiven a matrix of positive integers starting from any element of column 1. What is the maximum path sum you can get? Directions you can move in:\r\n(a) straight right\r\n(b)diagonally right upwards \r\n(c)diagonally right downwards\r\n Brute force and optimized both. \r\nThere is an infinite price array of amazon which is constantly updated by sellers as in the sale they reduce the prices of items. Sometimes they increase the price, so you have to find at any given time what will be k least priced elements in the array. You cannot store all elements in a heap because there is limited memory in your computer. Then move to heap discussion and complexities of every operation.\r\nClone a linked list.\r\nBinary Trees.\r\nCoin Exchange (DP). \r\nIslands Problem (Graph).\r\nFlatten a multilevel Linked List. \r\nFind the common elements in three sorted arrays. \r\nSearch in right rotated sorted array \r\nReturn the right view of a Binary Tree.\r\nThe strongly connected component in the grid.\r\nStack and queue.\r\nHeap top k question\r\nOne behavioral question \"Describe a situation when you have to learn a completely new technology, how would you handle such a situation?\"\r\nIntroduction.\r\nPopulate the next pointer in the binary tree. \r\nLength of the longest substring with distinct character. \r\nInternship and projects.\r\nRotate the linked list clockwise by k .\r\nIndex of elements gives given difference. \r\nFind the height of the tree but the tree is not a simple binary tree there is a doubly-linked list inside the tree.\r\nGiven string s and k you have to remove contiguous k characters from string but after removing if there is any character that continuously occurs for k time you have to remove that also. Should do in O(n).\r\nInput: uxaabbbaxxh, k=3 -. uxaaaxxh uxxxh uh So final string would be? \r\nGiven a matrix of positive integers starting from any element of column 1. What is the maximum path sum you can get? Directions you can move in:\r\n(a) straight right\r\n(b)diagonally right upwards \r\n(c)diagonally right downwards\r\n Brute force and optimized both. \r\nThere is an infinite price array of amazon which is constantly updated by sellers as in the sale they reduce the prices of items. Sometimes they increase the price, so you have to find at any given time what will be k least priced elements in the array. You cannot store all elements in a heap because there is limited memory in your computer. Then move to heap discussion and complexities of every operation.\r\n\r\n\r\nHR-INTERVIEW\r\nTell me a situation in which you made a tough decision. And what was its outcome?\r\nTell about a situation when you learnt something new by going out of your comfort zone. \r\nWhat is your favorite subject? \r\nHave you made any project related to your favourite subject? \r\nProject related question.\r\nIntroduction.\r\nWhen you felt hopeless and what you did at that time? \r\nWhat is the biggest mistake that you have ever made? What have you learnt from that mistake?\r\nIf stuck in a problem, will you take help from your peers or will you try to solve the problem on your own first?\r\nWhat is your motivation behind making projects and learning technologies? \r\nIf ever given a chance to teach your juniors, what will you teach them?\r\nWhat are your strengths and weaknesses?\r\n \r\n', '30   Min.', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-01 00:00:00', 2, '2022', NULL),
(9, 8, 3, '7.37', '60% B.tech', 'Engineer Traine', 'Coding and Aptitude test.', 'This is an elimination round.\r\nQuestions were MCQ, Response and Coding based.\r\nThis round contains two sections.\r\nSection 1-\r\nThis section contains Aptitude Questions.\r\nSection 2-\r\nThis section contains Coding & DBMS related.\r\n*Aptitude, verbal ability and logical reasoning.\r\n*DBMS\r\n*Coding\r\n', '3', 'INTERVIEW', '1. Difference between JavaScript and Java.\r\n2. Questions based on resume about the projects and questions on your achievements and technical skills. \r\n3. Question based on basics of Oops: Real life example of polymorphism.  \r\n4. Project related questions.\r\n5. Why this technology (that you have written in your resume)? Why not other technologies? \r\n6. Why this branch (your branch)\r\n7. Do you have any experience in IoT?\r\n8. What do you know about Optum and healthcare group\r\n9. Basics of any programming language and some logical questions.\r\n10. Questions related to every important field for e.g. CN, OS,DBMS,DSA.\r\n11.Questions on SDLC (software development life cycle)\r\n12. Questions on Keys (primary key, composite key, alternate key, super key candidate key)\r\n13. Difference between discover, innovation and invention\r\n14. Questions on cloud computing and Golang.\r\n15. Questions based on basic C and C++ questions.\r\n16. Introduction, Internship related questions, project related questions\r\n17. Python classes, python tuple, python list, self, keyword, range function,                some python pseudo codes, mutable and immutable, SQL query to find third salary, joins, foreign key, ACID properties, inheritance, abstraction, some situational and time management questions.\r\n', '20 Min.', 'INTERVIEW', '1. Introduce yourself. Why OPTUM? Location preference. Any questions?\r\n2. Ready to relocate? Weakness and ways to overcome it. \r\n3. How did you hear about Optum. Your strengths? your marks?\r\n4. Biggest challenge in life and you overcome the challenge.\r\n', '20 Min', 'N/A', 'N/A', 'N/A', 'N/A', 'Pending Approval', 'N/A', '2022-02-01 13:49:38', 4, '2022', 'grammer'),
